import React from "react";

const Navbar = () =>{
    return(
        <>
           <a href="/">About Us</a>
           <a href="contact">Contact Us</a>
           <a href="pokeapi">Pokeapi</a>
           <a href="covid19">Covid Tracker</a>
        </>
    )
}

export default Navbar;
